import React from 'react';
import {Badge, Button, Col, Input, Label, Row} from "reactstrap";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faShoppingCart} from "@fortawesome/free-solid-svg-icons";

const objectPrice = (props) => {

    const buttonStyle = {
        width: '100%'
    };

    const priceStyle = {
        textAlign: 'right'
    };

    const priceOption = {
        textAlign: 'left'
    };

  return(
      <div className='shadow p-3 mb-5 bg-white rounded'>
          <h4>$598.23</h4>
          <hr />
          <Button color='warning' style={buttonStyle}>
              Add to Cart <FontAwesomeIcon icon={faShoppingCart} size='1x' color='black'/>
          </Button>
          <hr />
          <div>
              <Row>
                  <Col>
                      <Label>
                          <Input type='radio' value='new' checked={props.priceOption === 'new'}
                                 onChange={(event) => props.changePriceOption = event.target.value} style={priceOption}/>{' '}
                          Buy New
                      </Label>
                  </Col>
                  <Col style={priceStyle}>
                      <Badge color='success'>$598.23</Badge>
                  </Col>
              </Row>
              <Row>
                  <Col>
                      <Label>
                          <Input type='radio' value='used' checked={props.priceOption === 'used'} onChange={(event) => props.changePriceOption = event.target.value}/>{' '}
                          Buy Used
                      </Label>
                  </Col>
                  <Col style={priceStyle}>
                      <Badge color='success'>$478.13</Badge>
                  </Col>
              </Row>
          </div>
          <hr />
          <div>
              <Row>
                  <Col style={priceOption}>
                      <Label>Quantitiy: </Label>
                  </Col>
                  <Col>
                      <Input type="select" name="select" id="exampleSelect">
                          <option>1</option>
                          <option>2</option>
                          <option>3</option>
                          <option>4</option>
                          <option>5</option>
                      </Input>
                  </Col>
              </Row>
          </div>
      </div>
  )
};

export default objectPrice;
